import React from "react";

function Header() {
  return (
    <header>
      <img src="../images/logo.png" alt="Logo Tuna" />
      <h1>Tuna Universidad de La Sabana</h1>
      <p>Inicio</p>
      <p>¿Quiénes somos?</p>
      <p>Galería</p>
      <button>Contáctanos</button>
    </header>
  );
}

export default Header;
